import React from "react";

const Homepage = (props) => {
  return (
      <div className="homepage">
          <div className="directory-menu">
            <div className="menu-item">
                <div className="content">
                    <h1 className="title">
                        Hats
                    </h1>
                </div>
            </div>
          </div>
      </div>
  )
};

export default Homepage;
